    [],nt"num_tags": 0,nt"name": "aerial-photography-and-imagery-ortho-corrected-2010-naip-imagery-seminole-county",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains polygons delineating
    the seams boundary between acquired imagery used in the creation of DOQQs and compressed
    county mosaic (CCM). The DOQQ and CCM products were created from imagery acquired
    in the National Agriculture Imagery Program (NAIP). These seam polygons can be used
    as a tool in determining the image source and date of each portion of the DOQQ or
    the CCM. The NAIP acquires digital ortho imagery during the agricultural growing
    seasons in the continental U.S.. A primary goal of the NAIP program is to enable
    availability of ortho imagery within one year of acquisition. The NAIP provides
    two main products: 1 meter ground sample distance (GSD) ortho imagery rectified
    to a horizontal accuracy within +/- 5 meters of reference digital ortho quarter
    quads (DOQQ's) from the National Digital Ortho Program (NDOP), or from the National
    Agriculture Imagery Program (NAIP); 1 meter GSD ortho imagery rectified within +/-
    6 meters to true ground. The tiling format of NAIP imagery is based on a 3.75' x
    3.75' quarter quadrangle with a 300 meter buffer on all four sides. The NAIP quarter
    quads are formatted to the UTM coordinate system using the North American Datum
    of 1983 (NAD83).",nt"owner_org": "b0b4c45b-a8ca-416b-b463-ee90d0a1a3df",nt"extras":
